VALUES ('Harry Potter y la piedra filosofal', 'Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y del insoportable primo Dudley. Se siente muy triste y solo, hasta que un buen día recibe una carta que cambiará su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el colegio interno Hogwarts de magia y hechicería. A partir de ese momento, la suerte de Harry da un vuelco espectacular. En esa escuela tan especial aprenderá encantamientos, trucos fabulosos y tácticas de defensa contra las malas artes. Se convertirá en el campeón escolar de quidditch, especie de fútbol aéreo que se juega montado sobre escobas, y hará un puñado de buenos amigos... aunque también algunos temibles enemigos. Pero, sobre todo, conocerá los secretos que le permitirán cumplir con su destino. Pues, aunque no lo parezca a primera vista, Harry no es un chico común y corriente. íEs un verdadero mago!', 'J. K. Rowling', 8, 1500, 'https://www.harrymedia.com/data/media/9/hp1-es-2020.jpg'),
('Alice in Wonderland', 'Aburrida en una calurosa tarde, Alice persigue al Conejo Blanco hasta bajar por una madriguera -sin pensar cómo podría salir. Y así es como cae al País de las Maravillas. En un país donde nada es lo que parece y las tartas, pociones y setas pueden hacerla encoger diez pulgadas o crecer hasta el tamaño de una casa, ¿será Alice capaz de encontrar de nuevo el camino de vuelta a casa?', 'Lewis Carroll', 24, 1430, 'http://2.bp.blogspot.com/_JXi92wDCOGk/TGF1W98DwWI/AAAAAAAABqI/jmXaiB8h0nE/s1600/Alice+book+cover2.jpg'),
('Harry Potter y la camara secreta', 'Harry Potter y los estudiantes de segundo año investigan una malévola amenaza para sus compañeros de clases de Hogwarts.', 'J. K. Rowling', 8, 1500, 'http://2.bp.blogspot.com/_mC3p3y_gsQY/S7CdmXNyomI/AAAAAAAAAGQ/kGeZNIgSGk4/s1600/harry+potter+2.jpg'),
('Marketing extraordiario', 'El lado oculto y futuro de los mercados', 'Damian Di Pace', 4, 1770, 'https://www.ecoeediciones.com/wp-content/uploads/2018/02/Marketing-extraordinario.jpg'),
('The music of you & me', 'Debido a una condición médica, Tara cree que nunca tendrá una familia propia. Travis tiene otros planes. Tara ha venido a la granja de sus tíos, donde tiene la intención de vivir una vida tranquila enseñando música rodeada de personas que la aman y comprenden la naturaleza limitante de su condición. Incluso su padre se fue después de presenciar su primer episodio, ¿cómo puede esperar algo más de alguien más?', 'Eloise Alden', 20, 1500, 'https://itswritenow.com/wp-content/uploads/2020/07/B07P9FHQ1N-171x258.jpg'),
('El bosque negro', 'Muy pocos son los que saben que en 1970 el profesor Tolkien realizó un viaje a Estados Unidos durante el cual activó una serie de poderes élficos ocultos en unos antiguos documentos. El lector que se interne en El Bosque Negro tras los pasos del profesor, hallará destinos que se ven alterados, leyendas que se hacen realidad y a dos heroínas que deben huir para salvar la vida en dos mundos completamente diferentes.', 'Steve Hillard', 8, 1536, 'http://arealibros.republica.com/files/2012/09/el-bosque-negro.jpg'),
('Rapunzel encuentra a un amigo', '¡Descubre cómo comenzó la amistad entre Rapunzel y Pascal!', 'Disney Princesas', 4, 1931, 'https://th.bing.com/th/id/OIP.WN6_ZKlhthjGUfCTqOSPdgHaKQ?pid=Api&rs=1'),
('El dia que se perdio la cordura', 'El doctor Jenkins, director del centro psiquiátrico de la ciudad, y Stella Hyden, agente de perfiles del FBI, se adentrarán en una investigación que pondrá en juego sus vidas, su concepción de la cordura y que los llevará hasta unos sucesos fortuitos ocurridos en el misterioso pueblo de Salt Lake diecisiete años atrás.', 'Javier Castillo', 24, 2164, 'https://ep01.epimg.net/elpais/imagenes/2018/06/18/escaparate/1529337843_719213_1529340158_sumario_normal.jpg'),
('Healing energy meditation', 'Meditación de energía curativa con fondo de Sonidos de la naturaleza. Este Programa de Meditación afecta tanto a su espacio consciente como inconsciente y energético.', 'Money Channel', 4, 1545, 'https://th.bing.com/th/id/OIP.qCkFmdM_tsYRJZXGGWvUBAHaLG?pid=Api&w=735&h=1102&rs=1'),
('Gallows wedding', 'Una novela oscura de brujería y amor prohibido ambientada en el contexto de la agitación religiosa en la época de Enrique VIII.', 'Rhona Martin', 20, 1523, 'https://i.ebayimg.com/images/g/pEoAAOSwfVpYn6wG/s-l600.jpg'),
('Roman der Archaeology', 'El Mundo De La Arqueologia en la antigua Roma', 'C. W. Ceram', 8, 1550, 'https://imagecache.markt.de/a0bMXqtiNM8qUzjKpfjFhvsbjCM=/fit-in/222x320/images_classifieds/7c/80/37b5-6554-4244-81d3-4332421d4deb/large.jpg'),
('Matilda', 'Matilda es una lectora empedernida con sólo cinco años. Sensible e inteligente, todos la admiran menos sus mediocres padres, que la consideran una inútil. Además tiene poderes extraños y maravillosos… Un día, Matilda decide desquitarse y empieza a emplearlos contra la abominable y cruel señorita Trunchbull.', 'Roald Dahl', 8, 3170, 'https://th.bing.com/th/id/OIP.IF0Y-VvNGlvNKiFHVlHkcQHaMa?pid=Api&rs=1'),
('High and dry', 'Enmarcado por la sobredosis casi fatal de un extraño en una fiesta, chantajeado para encontrar una misteriosa unidad flash que todos en la escuela parecen ansiosos por reprimir y presionado por su sombrío mejor amigo para lanzar un próximo partido, el jugador de fútbol de la escuela secundaria Charlie Dixon pasa una semana frenética intentando limpiar su nombre, recuperar a la chica de sus sueños y escapar de un pasado que puede ser responsable de todos sus problemas actuales.', 'Sarah Skilton', 8, 1840, 'https://roc21cdn-roc21.netdna-ssl.com/blog/wp-content/uploads/2014/11/portadas-libros-2014-seis.jpg'),
('Passionate pursuit', 'Todos los temas tratados en el libro son propicios para reavivar el fuego y la pasión por Dios. Temas como desarrollar y mantener el hambre de Dios, descubrir cómo el amor paternal de Dios disipa todo temor y rechazo, también se abordan es vivir una vida de total dependencia de Dios y cómo eso nos lleva inevitablemente a grandes hazañas.', 'James W. Goll', 24, 1550, 'https://i.gr-assets.com/images/S/photo.goodreads.com/books/1426714327l/22789890.jpg'),
('A day and a life', 'El ritmo monástico de la vida en St Alcuins significa que todo está en paz en la superficie, pero debajo hay fuertes corrientes mientras cada monje lucha con sus propias esperanzas, miedos, desafíos y tentaciones. No todos los monjes están asentados y seguros. La tristeza impregna el monasterio cuando se descubre temprano una mañana que uno de los novicios, el hermano Cedd, ha desaparecido.', 'Penelope Wilcock', 20, 1530, 'https://4.bp.blogspot.com/-VsCn56HaLQ8/V73-HsAdLAI/AAAAAAAAKdQ/XW-ezUUR1oIwuLqviKM3EpnXF0EQ1eAbwCLcB/s1600/514brqOCxYL.SX316.jpg'),
('Animales fantasticos y donde encontrarlos', 'En 1926, el mago experto en zoología Newt Scamander hace una breve parada en Nueva York mientras viaja catalogando y capturando criaturas mágicas por el mundo. Jacob, un humano corriente, provoca por error que las criaturas escapen y se oculten por la ciudad. Scamander tendrá que atraparlas de nuevo, antes de que causen problemas.', 'J. K. Rowling', 8, 1340, 'http://media.biobiochile.cl/wp-content/uploads/2017/02/animales-fanasticos-nueva-portada.jpg'),
('Batalla de reyes', 'Ante un niño nacido del demonio se erigen una fortificación maligna y un destino ya escrito.El primer volumen de la trilogía histórico épica que recupera la época y el personaje que dieron lugar a la leyenda de Merlín.', 'M. K. HUME', 8, 1000, 'https://bibliobulimica.files.wordpress.com/2014/07/portada-libro.jpg'),
('En los lugares de la inocencia perdida', 'En la España de los sesenta del pasado siglo XX tres estudiantes universitarios establecen entre ellos vínculos de camaradería, complicidad, amor, sexo, deslealtad, y distancia. La muerte accidental de uno de ellos condicionará la vida de los otros dos hasta llegar a marcarlos definitivamente. La novela de John Steinbeck Al Este del Edén jugará un papel decisivo en la frágil, enfermiza y contradictoria vida de Mareko cuya incontrolable deriva la llevará a adoptar una inaceptable resolución.', 'Jose Luis Palma', 8, 1380, 'https://i.pinimg.com/originals/8e/cd/2d/8ecd2d01bc0307e14eb505af75075a13.jpg'),
('Diario futuro', 'Es una historia llena de misterio que no se puede leer una sola vez y a la que todo lector regresa.', 'Aura', 8, 1270, 'http://3.bp.blogspot.com/-UXRu9v32vGM/UEC83WH6TqI/AAAAAAAABeM/8hdHdHPG04I/s1600/diaF.jpg'),
('El libro de los errores', 'A lo largo de los siglos, las páginas de un valioso libro han sido custodiadas por generaciones de Guardianes, quienes han arriesgado todo para mantenerlas en secreto hasta el día de hoy, en que sus valiosas enseñanzas serán reveladas.', 'Skip Prichard', 24, 1460, 'https://www.planetadelibros.com.ar/usuaris/libros/fotos/282/m_libros/281012_portada_el-libro-de-los-errores_skip-prichard_201809252045.jpg'),
('El libro de la selva', 'La fábula del niño Mowgli criado por los lobos, del oso Baloo, de la pantera Bagheera y del malvado tigre Shere Khan se ha convertido en un arquetipo universal que reúne, como los grandes mitos, lo mejor y lo peor de las andanzas del ser humano en esa jungla inmensa que es el planeta Tierra.', 'Rudyard Kipling', 8, 1320, 'https://www.planetadelibros.com.ar/usuaris/libros/fotos/214/original/portada_el-libro-de-la-selva_rudyard-kipling_201602291625.jpg'),
('Harry Potter y el caliz de fuego', 'Es el cuarto libro de la serie literaria Harry Potter, escrita por la autora británica J. K. Rowling en 2000. Ella, antes de que se publicase el libro advirtió que uno de los personajes del libro moriría, dejando mucha especulación acerca de quién podría ser.', 'J. K. Rowling', 8, 1360, 'https://ciervomaya.files.wordpress.com/2011/07/harry.jpg'),
('He died with his eyes open', 'En los tres procedimientos policiales que componen la Serie Factory, Derek Raymond ha creado un narrador que amenaza con convertirse en una figura de culto mientras preserva su anonimato.', 'Derek Raymond', 8, 1390, 'https://www.recreoviral.com/wp-content/uploads/2015/06/30-asombrosas-portadas-de-libros-26.jpg'),
('La vida escondida entre los libros', 'Una maravillosa novela que es un canto de amor a los libros, un bonito homenaje a la lectura y a todos quienes encuentran en ella su redención en una novela cuya protagonista es del todo inolvidable. Loveday Cardew prefiere los libros antes que las personas.', 'Stephanie Butland', 8, 1290, 'https://www.udllibros.com/imagenes/9788417/978841730204.JPG'),
('Two', 'Después de escapar del Biotech Hub, pensaron que podían respirar tranquilos, o al menos un poco más tranquilos. Pero cuando las bombas golpean el Centro de Bienestar Social solo unas horas después de su llegada, queda claro que no hay dónde esconderse, y lo que Biotech hará para recuperarlas no tiene fin.', 'Leigh Ann Kopans', 24, 1940, 'http://2.bp.blogspot.com/-ho2AmW0d35M/VXisfjyPTXI/AAAAAAAARhk/fmAbLid3MxQ/s1600/two-leighann-kopans-one-universe.jpg'),
('Los hermanos Sisters', 'En 1851, una pareja de hermanos, asesinos a sueldo, son contratados para encontrar y abatir a un buscador de oro.', 'Patrick de Witt', 4, 1270, 'https://www.recreoviral.com/wp-content/uploads/2015/06/30-asombrosas-portadas-de-libros-28.jpg'),
('Los ojos de la noche', 'Perdida en el paisaje del frío, Dalila, conoce a Tharo, de quien se enamora y por quien vivirá esas semanas entre sombras siniestras, investigando hechos que conducen a esas sombras, sobre todo la de un tal Zasiok, el cual termina vinculado al derrotero trágico del paraje.', 'Ines Garland', 4, 1450, 'https://www.loqueleo.com/ar/uploads/2016/03/tapalosojosdelanoche.jpg'),
('Harry Potter and the secret chamber', 'Deja que la magia de J.K. La serie clásica de Rowling te lleva de regreso al Colegio Hogwarts de Magia y Hechicería, pero esta vez, ¡en inglés!', 'J. K. Rowling', 8, 1002, 'https://th.bing.com/th/id/OIP.FLI2qc5HJcWmYvuscdeY0wHaLW?pid=Api&rs=1'),
('Una Tierra Prometida', 'En este extraordinario primer volumen de sus esperadas memorias presidenciales, Barack Obama narra la historia de su sorprendente ev olución de ser un joven en busca de su identidad a convertirse en líder del mundo occidental, describiendo con increíble detalle tanto su formación política como los momentos cumbre del primer período de su histórica presidencia, una época de una gran conmoción y de profunda transformación.', 'Barack Obama', 83, 1899, 'https://contentv2.tap-commerce.com/cover/large/9789877950175_1.jpg?id_com=1113'),
('Php: Programación Web avanzada para profesionales', 'El libro es una guía en el desarrollo de soluciones día a día e intenta ser una base para que las recetas sean extendidas de acuerdo a la necesidad o bien disparen nuevas ideas para sus proyectos. Es ideal para nuevos programadores que pueden tomar las recetas como buenas prácticas sustentadas en la experiencia del autor o para programadores avanzados que busquen soluciones puntuales.', 'Christian Cibelli', 53, 2500, 'https://images.cdn2.buscalibre.com/fit-in/360x360/ab/cb/abcbacd24d6e2ac375f2a73abe5e42ac.jpg'),
('México 86. Mi Mundial mi Verdad', 'A 30 años del triunfo argentino en México 86, Diego Maradona cuenta por primera vez y en primera persona detalles inéditos de aquel campeonato inolvidable.', 'Diego Maradona', 48, 250, 'https://images.cdn3.buscalibre.com/fit-in/360x360/f8/f9/f8f9ab428b6ae2560232804e52b22b5d.jpg'),
('Alimentación y deporte', 'Este artículo no cuenta con descripción', 'Marcia Onzari', 1, 1000, 'https://images.cdn3.buscalibre.com/fit-in/360x360/67/3f/673f79eb30d2514ed1a5a5bd7e160bd8.jpg'),
('Doña Petrona especial reposteria', 'Un compilado con las principales recetas de la repostería internacional hechas por Doña petrona, probadas y logradas después de prolijas pruebas, que le permitirán desplegar su creatividad y deleitar a toda la familia. Puestas al alcance de todos en forma clara, sencilla, fácil y exacta, su nieta Marcela Gandulfo seleccionó aquí sus mejores recetas y secretos de las más fina repostería clásica, tradicional y moderna.', 'Doña Petrona', 13, 480, 'https://images.cdn2.buscalibre.com/fit-in/360x360/f5/2c/f52c93bad5109cffdc10a951e6f67788.jpg'),
('Doña Petrona recetas económicas', 'En esta completa obra nos ocuparemos de: Los ingredientes. Cómo aprovechar la comida. Consejos para la cocinera moderna. Cómo interpretar con éxito una receta. Cómo calcular las cantidades por persona. Los tiempos y temperaturas de cada cocción', 'Doña Petrona', 5, 480, 'https://images.cdn2.buscalibre.com/fit-in/360x360/54/4e/544e305b308f6896f82938bf901a87de.jpg'),
('Que son las neuronas', 'El cerebro es hoy la nueva frontera de la ciencia. Desde su puesto de avanzada, en este libro –que atrapará a todos aquellos curiosos que sientan avidez por los conocimientos de su tiempo–, Osvaldo D. Uchitel nos invita a un viaje fabuloso por los vericuetos de la usina de esa ingeniería microscópica: las neuronas, ladrillos fundamentales del sistema nervioso.', 'Osvaldo Uchitel', 1, 550, 'https://images.cdn3.buscalibre.com/fit-in/360x360/20/e8/20e8ed8dda6a9ff8e1a8b9822ac0ddb7.jpg'),
('Chocolate', 'A estas alturas de su carrera, presentar a una figura como Osvaldo Gross sería poco menos que redundante. De más estaría mencionar que es uno de los referentes indiscutidos de la gastronomía y la pastelería no sólo en la Argentina sino también en Latinoamérica, Estados Unidos y Europa.', 'Osvaldo Gross', 22, 2000, 'https://images.cdn1.buscalibre.com/fit-in/360x360/22/69/226903b0c8ab623d5b48ea75b611217e.jpg'),
('Los Señores de las finanzas', 'Los señores de las finanzas es una obra magistral que nos sumerge en una época y unos personajes que nos dan una perspectiva única de la situación económica actual. En el año 29 se produjo una de las peores crisis financieras de la historia. Mucho se ha escrito sobre las consecuencias que tuvo pero poco sobre sus causas.', 'Liaquat Ahamed', 8, 3000, 'https://images.cdn3.buscalibre.com/fit-in/360x360/90/a4/90a4177e8c652cd667700a8e12926a77.jpg'),
('Pequeño cerdo capitalista', '¿Realmente quieres sacarle el mejor provecho a tu dinero? Entonces este libro es para ti. No importa si eres músico, poeta y loco; doctor en ciencias ocultas, bohemio, activista, amante de la naturaleza, cirujano, arquitecto de tu propios destino, floricultor, psicoanalista no importa si no tienes idea de finanzas personales, tienes grandes nociones o crees que eres un experto. Con Pequeño cerdo capitalista tendrás las herramientas más efectivas para saber ahorrar, invertir y repartir de la mejor manera tus ingresos.', 'Sofia Macias', 13, 2550, 'https://images.cdn3.buscalibre.com/fit-in/360x360/1e/26/1e261576f7d0f1dfd6aaa1953f6f621c.jpg'),
('Alien: El archivo', 'Un libro de lujo que reúne toda la información clave sobre la creación de las cuatro películas, desde las primeras ideas de guión hasta el montaje final. Incluye storyboards de Ridley Scott, arte conceptual de Moebius, H.R. Giger, Ron Cobb, Chris Foss y Syd Mead, fotografías de los modelos de las criaturas, los escenarios, el vestuario y las armas, así como comentarios sobre las escenas eliminadas e ideas desechadas.', 'Mark Salisbury', 13, 4600, 'https://images.cdn3.buscalibre.com/fit-in/360x360/8f/48/8f489fdd8bd12bb40c31faed92d569bf.jpg'),
('Terminator, el Imperio Skynet', 'Este artículo no cuenta con descripción', 'Miguel García González', 8, 3720, 'https://images.cdn2.buscalibre.com/fit-in/360x360/c7/d9/c7d97e76decf5b5376ab79b251086dd2.jpg'),
('Freddy vs. Jason', 'description', 'Zachary Petersen', 14, 1620, 'https://images.cdn3.buscalibre.com/fit-in/360x360/09/53/095321e2c16d3695a1f85805ad3f57a4.jpg'),
('Violeta Parra Poesía', 'Por primera vez en la historia, un libro de poesía se convierte en Best Seller en Chile. Mas de 15.000 ejemplares vendidos en su lanzamiento.', 'Parra Violeta', 4, 1590, 'https://images.cdn1.buscalibre.com/fit-in/360x360/75/47/75474f3980f8366c695349ed5016c2ed.jpg'),
('Poesías de amor', 'Este artículo no cuenta con descripción', 'Poesía antológica', 3, 1890, 'https://images.cdn3.buscalibre.com/fit-in/360x360/f7/64/f764bc4d8c20a01964a6cee0adc6a4c8.jpg'),
('Don Quijote de la Mancha', 'Esta edición del Ingenioso hidalgo don Quijote de la Mancha ha sido adaptada para uso escolar por la Real Academia Española.', 'Miguel De Cervantes', 9, 3080, 'https://images.cdn1.buscalibre.com/fit-in/360x360/6e/ea/6eea33cf69a6677dee8c657d09e2c30c.jpg'),
('Yo cumbio', 'Agustina Vivero ha causado un gran revuelo en Internet luego de haber abierto su propio fotolog, acto que sin lugar a dudas marcó un antes y un después en su vida ya que se convirtió en la usuaria más famosa de Argentina.', 'Cumbio', 1, 5890, 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1372723188l/18070489.jpg'),
('Dune', 'En el desértico planeta Arrakis, el agua es el bien más preciado y llorar a los muertos, el símbolo de máxima prodigalidad. Pero algo hace de Arrakis una pieza estratégica para los intereses del Emperador, las Grandes Casas y la Cofradía, los tres grandes poderes de la galaxia. Arrakis es el único origen conocido de la melange, preciosa especia y uno de los bienes más codiciados del universo.', 'Frank Herbert', 5, 1200, 'https://images-na.ssl-images-amazon.com/images/I/41TCYOZgv4L._SX326_BO1,204,203,200_.jpg'),
('Viaje al centro de la tierra', 'El profesor Lidenbrock, que une a su condición de verdadero sabio una terquedad sin límites, descifra un viejo pergamino devolviendo pacientemente su sentido a los incomprensibles signos que en él se contienen. ¡Extraordinarios peligros de la lectura! El descifrado de aquel texto arrastrará inevitablemente al propio Lidenbrok, a su joven sobrino Axel y al valeroso cazador Hans Bjelke hasta el mismísimo centro de la Tierra, poblado de animales antediluvianos, tempestades terribles y otros riesgos sin mayor importancia.', 'Julio Verne', 23, 1560, 'http://imag.lecturalia.com/img/libro/viaje-al-centro-de-la-tierra-1995.jpg'),
('El faro del fin del mundo', 'La misión pacífica encomendada a los fareros Vázquez y Felipe en una isla aparentemente deshabitada, va a trastornarse por completo con la aparición de unos piratas sin escrúpulos que actuarán con inusitada violencia.', 'Julio Verne', 7, 1250, 'https://imagessl7.casadellibro.com/a/l/t5/17/9788468224817.jpg'),
('Star Wars', 'Star Wars irrumpió en nuestras pantallas de cine en 1977, y el mundo no ha sido el mismo desde entonces. Después de pasarse la década de 1970 viendo películas cínicas y deprimentes, el público abrazó con entusiasmo la energía positiva del universo Star Wars mientras seguía los pasos del granjero Luke Skywalker en su viaje por las galaxias, conociendo personajes extraordinarios como el misterioso ermitaño Obi-Wan Kenobi, los piratas espaciales Han Solo y Chewbacca, los leales droides C-3PO y R2-D2, la audaz princesa Leia Organa y el temible Darth Vader, al servicio del tenebroso y malvado emperador.', 'Paul Duncan', 23, 2550, 'https://lasdaoalplay.com/wp-content/uploads/2015/02/starwars.png'),
('El dominio mental', 'La geopolítica de la mente.', 'Pedros Baños Bajo', 3, 1550, 'https://images-na.ssl-images-amazon.com/images/I/41cLLMypLGL._SX314_BO1,204,203,200_.jpg'),
('Los crímenes de la calle Morgue', 'Se trata del primer relato de detectives propiamente dicho de la historia de la literatura, es decir, la primera historia sobre detectives que reúne todos los elementos que más aún más tarde van a retomarse como característicos de las novelas policiales.', 'Edgar Allan Pohe', 23, 1650, 'https://img1.od-cdn.com/ImageType-400/6448-1/52D/4D0/E3/%7B52D4D0E3-7392-4962-8FB4-FE64A6CD0FE8%7DImg400.jpg'),
('Estudio en escarlata', 'Estudio en escarlata es una novela de misterio escrita por Arthur Conan Doyle y publicada en la revista Beetons Christmas Annual de noviembre de 1887, con ilustraciones de David Henry Friston.​ Se trata de la primera aparición de Sherlock Holmes y el Dr. Watson.​', 'Arthur Conan Doyle', 4, 1590, 'https://http2.mlstatic.com/D_NQ_NP_985058-MLA43122582772_082020-O.webp'),
('El misterioso caso de Styles', 'Todos los huéspedes de la vieja mansión tenían motivos para matar a la viuda Emily Inglethorp y ninguno de ellos posee una coartada satisfactoria. Para solucionar el crimen entra en acción el detective Hércules Poirot, irresistible personaje creado por Agatha Christie y que aparece por vez primera en este intrigante caso.', 'Agatha Christie', 12, 1480, 'https://www.planetadelibros.com.ar/usuaris/libros/fotos/314/m_libros/portada_el-misterioso-caso-de-styles_agatha-christie_202003051927.jpg'),
('El halcón maltés', 'Una novela publicada en el año 1930 por Dashiell Hammet y que está considerada por público y crítica como uno de los grandes exponentes del género.', 'Dashiell Hammett', 9, 1950, 'https://ffw.uol.com.br/app/uploads/noticias/2012/03/The-Maltese-Falcon.jpg'),
('El talento de Mr. Ripley', 'El talento de Mr. Ripley es una novela de Patricia Highsmith publicada en 1955. Se enmarca dentro del género negro-thriller psicológico y tiene lugar en su mayor parte en Europa.', 'Patricia Highsmith', 4, 890, 'https://m.media-amazon.com/images/I/51RnR0YjF6L.jpg'),
('Misery', 'Paul Sheldon es un escritor que sufre un grave accidente y recobra el conocimiento en una apartada casa en la que vive una sospechosa mujer, corpulenta y de extraño carácter. Se trata de una antigua enfermera, involucrada en varias muertes misteriosas ocurridas en diversos hospitales. Fanática de un personaje de una serie de libros que él ha decidido dejar de escribir, está dispuesta a hacer todo lo necesario para convencerlo de que retome la escritura. Esta mujer es capaz de los mayores horrores, y Paul, con las piernas rotas y entre terribles dolores, tendrá que luchar por su vida.', 'Stephen King', 5, 1450, 'https://usishield.com/wp-content/uploads/2019/10/220px-Stephen_King_Misery_cover.jpg'),
('La naranja mecánica', 'El protagonista, Alex, y sus amigos, o drugos, viven en un mundo de crueldad y destrucción. Tras la brutal violación de la mujer de un escritor, Alex es detenido y llevado a un centro de rehabilitación, donde será elegido para participar en un novedoso y drástico experimento que pretende que aborrezca la violencia.', 'Anthony Burgess', 20, 550, 'https://http2.mlstatic.com/D_NQ_NP_757947-MLA42494491153_072020-O.webp'),
('El diario de Ana Frank', 'Ana, a la sazón una niña de trece años, escribió su estremecedor Diario: un testimonio único en su género sobre el horror y la barbarie nazi, y sobre los sentimientos y experiencias de la propia Ana y sus acompañantes. Ana murió en el campo de Bergen-Belsen en marzo de 1945. Su Diario nunca morirá.', 'Ana Frank', 18, 980, 'https://http2.mlstatic.com/D_NQ_NP_740940-MLA43347990382_092020-O.webp'),
('Más fuerte que la adversidad', 'Más fuerte que la adversidad es un aliado emocional y una herramienta indispensable para aprender a desarrollar la confianza en nosotros mismos, tomar el control de lo que sí depende de nosotros, enfrentar la incertidumbre y aprender a gestionar emociones como la ansiedad, la tristeza y la ira.', 'Walter Riso', 5, 990, 'https://planetadelibrosar5.cdnstatics.com/usuaris/libros/fotos/325/m_libros/324347_portada_mas-fuerte-que-la-adversidad_walter-riso_202009252054.jpg'),
('Calu Rivero', 'Carla Soledad Rivero nació en Recreo, Catamarca, el 5 de abril de 1987. Es actriz. Activista ambiental, colabora con entidades que propician una moda sustentable.', 'Calu Rivero', 850, 600, 'https://cdn.cienradios.com/wp-content/uploads/sites/3/2019/03/Calu-Rivero-libro-1.jpg'),
('Sexo ATR', 'La Lic. Cecilia Ce nos ofrece en este libro-guía información sexual valiosísima de una manera gráfica, divertida, empática y respetuosa, con la intención de que cada uno haga su propio recorrido de autodescubrimiento y reafirmación, para disfrutar de la sexualidad en libertad. Este es el libro sobre sexo que todos siempre ansiamos tener. Esta es la educación sexual que queremos.', 'Cecilia Ce', 63, 1340, 'https://puntoed.com.ar/img/libros/sexo-atr-a-todo-ritmo-la-educacion-sexual-que-queremos.jpg'),
('Caos', 'Una fiesta, varias habitaciones, tres tiempos: pasado errático, presente mágico, futuro incierto. Puertas que abren a mundos y cierran miedos. Cinco colores jugando a adivinar de qué color pintás la vida. Historias dentro de historias.', 'Magalí Tajes', 12, 800, 'https://http2.mlstatic.com/D_NQ_NP_683433-MLA40609686160_012020-O.webp');


